import React from 'react';

const Order = (props) => {
  const { totalPrice } = props.location.state || {};

  return (
    <div>
      <h2>Total Price of Ordered Items</h2>
      {totalPrice ? <p>Total Price: ${totalPrice.toFixed(2)}</p> : <p>Total Price is not available</p>}
    </div>
  );
};


export default Order;
